def smbsrv_reply_negprot(rq_in: smb_request_buffer):

    # https://github.com/samba-team/samba/blob/7cae7aad1ca6dcd5e0a3a102f36af74fa49a2c2b/source4/smb_server/smb/negprot.c#L488
    supported_protocols = [
        # [proto_name, short_name, reply_fn, proto_level]
        ["SMB 2.002", "SMB2", "reply_smb2", protocol_types.PROTOCOL_SMB2_02],
        ["NT LANMAN 1.0", "NT1", "reply_nt1", protocol_types.PROTOCOL_NT1],
        ["NT LM 0.12", "NT1", "reply_nt1", protocol_types.PROTOCOL_NT1],
        ["LANMAN2.1", "LANMAN2", "reply_lanman2", protocol_types.PROTOCOL_LANMAN2],
        ["LM1.2X002", "LANMAN2", "reply_lanman2", protocol_types.PROTOCOL_LANMAN2],
        ["Samba", "LANMAN2", "reply_lanman2", protocol_types.PROTOCOL_LANMAN2],
        ["DOS LM1.2X002", "LANMAN2", "reply_lanman2", protocol_types.PROTOCOL_LANMAN2],
        ["Windows for Workgroups 3.1a", "LANMAN1", "reply_lanman1", protocol_types.PROTOCOL_LANMAN1],
        ["LANMAN1.0", "LANMAN1", "reply_lanman1", protocol_types.PROTOCOL_LANMAN1],
        ["MICROSOFT NETWORKS 3.0", "LANMAN1", "reply_lanman1", protocol_types.PROTOCOL_LANMAN1],
        ["MICROSOFT NETWORKS 1.03", "COREPLUS", "reply_coreplus", protocol_types.PROTOCOL_COREPLUS],
        ["PC NETWORK PROGRAM 1.0", "CORE", "reply_corep", protocol_types.PROTOCOL_CORE]
    ]


    protos = []
    p = rq_in.vwv

    # TODO , we miss some bytes, we skip them for now
    p = p[2:]

    while True:
        string, string_len = req_pull_ascii4(rq_in.bufinfo, p)
        p = p[string_len+1:]

        if string_len == 0 or len(string) == 0:
            break

        protos.append(string)


    print(f"Requestet Protocols: {protos}")


    # normally we would then here compare which we can, but we will accept ALL

    for prot in protos:
        if prot == "LANMAN1.0" or prot == "Windows for Workgroups 3.1a" or prot == "MICROSOFT NETWORKS 3.0":
            return reply_lanman1(rq_in)
        elif prot == "LANMAN2.0" or prot == "LANMAN2.1" or prot == "LM1.2X002" or prot == "Samba" or prot == "DOS LM1.2X002":
            return reply_lanman2(rq_in)


    return None





