        if NBT_HDR_SIZE + MIN_SMB_SIZE > len(buf):
            # Invalid SMB packet
            raise ArgumentError

        #https://github.com/samba-team/samba/blob/7a662e097be5e0d3f7779fa544486968b8f57063/source4/smb_server/smb/receive.c#L383
