        #current_pointer += self.NBT_HDR_SIZE


        parsed_fields['SMB_MAGIC'] = IVAL(buf, NBT_HDR_SIZE)

        if parsed_fields['SMB_MAGIC'] != SMB_MAGIC:
            # Non-SMB packet
            raise ArgumentError


        #https://github.com/samba-team/samba/blob/7a662e097be5e0d3f7779fa544486968b8f57063/source4/smb_server/smb/receive.c#L394
        rq_in = smb_request_buffer(buf)
        rq_in.hdr = rq_in.buffer[NBT_HDR_SIZE:]
        rq_in.vwv = rq_in.hdr[HDR_VWV:]
        rq_in.wct = CVAL(rq_in.hdr, HDR_WCT)

        #https://github.com/samba-team/samba/blob/7a662e097be5e0d3f7779fa544486968b8f57063/source4/smb_server/smb/receive.c#L403
        parsed_fields['command'] = CVAL(rq_in.hdr, HDR_COM)
        command_name = smb_messages[parsed_fields['command']][0]
        
        
        #https://github.com/samba-team/samba/blob/7a662e097be5e0d3f7779fa544486968b8f57063/source4/smb_server/smb/receive.c#L405
        #if (rq_in.vwv[VWV(rq_in.wct)] <= rq_in.buffer[rq_in.])



        flag2 = SVAL(rq_in.hdr, HDR_FLG2)

        # /* fix the bufinfo */

        command2 = CVAL(rq_in.hdr, HDR_COM)

        ### switch message
        if command_name == "SMBnegprot":
            return smbsrv_reply_negprot(rq_in)


        if command_name != 'SMBnegprot':
            print(command_name)


        return None





